Though not the first to sport a â€œhelmet of bobbed brunette hair,â€ Brooks was the epitome of â€œthe disdainful flapper of the 1920's,â€ famous for â€œblatantly flaunting the accepted sexual and societal roles of women.â€ She once said â€œI have a gift for enraging people, but if I ever bore you, it'll be with a knife.â€
 
Born in a tiny Kansas town in 1906, dad was a lawyer, mom a pianist. Vivian Vance (Ethel Merman) was a childhood friend. At 16 she joined a dance company, went to NYC. She joined the Ziegfeld Follies and was â€œdiscoveredâ€ while dancing  in George Whiteâ€™s (1924) â€œScandals.â€ The â€œlegendary actressâ€ was independent, spoke her mind, & had a rebellious nature. In NYC her â€œpersonal behaviorâ€ caused Brooks trouble: "Within a month, my wearing apparel had got me kicked out of 2 hotels.â€
 
She began making silent films around 1925, but left in 1928 after a Paramount executive â€œhad turned down her request for a raise.â€ She went to work in Europe and proved â€œshe was an actress with an enduring talent.â€ In 1929 Brooks played â€˜Luluâ€™ in Pabst's Pandora's Box, an â€œamoral temptressâ€ that the actress was compared to for the rest of her life.
 
Home from Europe, her â€œdisputes with the Hollywood executives continued & she appeared only in minor roles.â€ Brooks filed for bankruptcy then retired from acting in 1938, having made 24 films (many are lost.) Brooks had 2 bad marriages and no kids; at some point she indulged in an affair with the founder of CBS who â€œsecretly provided her with a yearly pension for the rest of her life.â€ In the late 30â€™s she made an unsuccessful bid for a comeback.
 
Brooks began writing around 1943, though she spent the 40â€™s working odd jobs in NYC, including stints as a â€œsales girl at Saks 5th Avenue, gossip columnist & radio commentator.â€ She moved to Rochester in 1956 at the behest of the curator of the Eastman House museum. She â€œstudied films, including 7 of her own,â€ and focused on writing. Her memoir, Lulu in Hollywood, was published in 1985 to great acclaim.
 
